func numberOfPowerfulInt(start int64, finish int64, limit int, s string) int64 {
    count := int64(0)
    sInt, _ := strconv.ParseInt(s, 10, 64)
    length := len(s)
    multiplier := int64(math.Pow10(length))

    // Check if s itself is within the range and conditions
    if sInt >= start && sInt <= finish {
        count++
    }

    for i := 1; i <= limit; i++ {
        for j := 0; j < int(math.Pow(float64(limit+1), float64(j))); j++ {
            prefix := int64(i)*int64(math.Pow(float64(limit+1), float64(j)))
            number := prefix*multiplier + sInt
            if number > finish {
                break // Exit if the number exceeds the finish value
            }
            if number >= start && number <= finish {
                count++
            }
        }
    }

    // Deduct cases where the prefix is not needed if s starts with a digit higher than limit
    if int(s[0]-'0') > limit {
        count--
    }

    return count
}
